    "2016-07-27T22:23:06.852561",nt"name": "fws-national-wildlife-refuge-system-wilderness-fellows-report-on-wilderness-character-moni-67ca7",nt"isopen":
    false,nt"url": null,nt"notes": "This report provides a detailed summary
    of the baseline wilderness character assessment completed for the Seney Wilderness
    on the Seney National Wildlife Refuge, located in the eastern Upper Peninsula of
    Michigan.  The purpose of this report is multi-dimensional. It establishes a wilderness
    character monitoring program for the Seney Wilderness and provides baseline data
    for future trend analysis. An understanding of the information in this report may
    also aid resource specialists by informing management decisions within the Seney
    Wilderness. Finally, this report is meant to accompany and explain the quantitative
    results of Seneyu2019s wilderness character assessment that have been entered into
    a national wilderness character monitoring database.  A total of 31 measures were
    used to assess the following: untrammeled quality, natural quality, undeveloped
    quality, and solitude or primitive and unconfined recreation quality.",nt"license_title":
